import React from 'react';
import { useSearchParams } from 'react-router-dom';

const About = () => {
  const [searchParams] = useSearchParams().get('id');
  const movieId = searchParams;
  return (
    <React.Fragment>
      <p>{movieId}</p>
    </React.Fragment>
  );
};

export default About;
